import React from 'react';
import { Container, CssBaseline, Typography, Grid, Box} from '@material-ui/core';
import styles from './Backboard.module.css';

function Backboard(props) {
    return (
        <Grid container className={styles.container}>
            <Box 
                boxShadow={5}
                bgcolor="light-green"
                m={1}
                p={1}
                style={{ width: '26rem', height: '20rem'}}
            >   Boo
            </Box>
        </Grid>
    );
}

export default Backboard;
